  handleGetTabsName(e) {
    let self = this;
    let CurrentActive = e.target.name;
    if (CurrentActive === "Task") {
      this.setState({
        TaskTab: 1,
        NotesTab: 0,
        ClaimTab: 0,
      });
    } else if (CurrentActive === "Notes") {
      this.handleGetNotesTabDetails(this.state.ticket_Id);
      this.setState({
        TaskTab: 0,
        NotesTab: 3,
        ClaimTab: 0,
      });
    } else if (CurrentActive === "Claim") {
      this.setState({
        TaskTab: 0,
        NotesTab: 0,
        ClaimTab: 2,
      });
    } else if (CurrentActive === "Appointment") {
      this.setState({
        TaskTab: 0,
        NotesTab: 0,
        ClaimTab: 0,
        AppointmentTab: 0,
      });
    }
    setTimeout(function () {
      self.props.history.push({
        state: self.state,
      });
    }, 100);
  }
