  handleTicketSourceChange = (e) => {
    let self = this
    let value = e.target.value;

    self.setState({
      ticketSourceId: value,
      ticketMailerFooter: "",
      mailBodyData: "",
      tempName: "",
      mailFiled: { userCC: "" },
    });
    if (value == "Mails") {
      self.handleGetMailFooterData();
    }
    if (value === "SMS") {
      self.setState({
        isSMS: true,
        // isFromFB: false,
        // isGoogleReview:false,
        // isFromInsta:false
      });
    }
    if (value === "GoogleReview") {
      self.setState({
        isGoogleReview: true,
        isFromFB: false,
        isFromInsta: false,
        isSMS: false,
      });
    }
    if (value === "Facebook") {
      self.setState({
        isFromFB: true,
        isGoogleReview: false,
        isFromInsta: false,
        isSMS: false,
      })
    }
    if (value === "Instagram") {
      self.setState({
        isFromInsta: true,
        isGoogleReview: false,
        isFromFB: false,
        isSMS: false,
      })
    }
    else {
      self.setState({
        // isSMS: false,
        // isGoogleReview: false,
        // isFromFB: false,
        // isFromInsta: false,
        ticketMailerFooter: "",
        mailBodyData: "",
        tempName: "",
        mailFiled: { userCC: "" },
      });
    }
  };

