  formatDate = (val) => {
    let test = val;
    if (val.includes("[")) {
      test = val.split("[")[0];
    }
    let dateVal = new Date(test);
    let date = dateVal.getDate();
    let month = dateVal.getMonth() + 1;
    let year = dateVal.getUTCFullYear();
    if (month <= 9) {
      month = "0" + month;
    }
    if (date <= 9) {
      date = "0" + date;
    }
    var todayDate = date + "-" + month + "-" + year;
    return todayDate;
  };

